DROP TABLE IF EXISTS `weather`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `weather` (
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `status` varchar(20) NOT NULL COMMENT 'get_status()',
  `wind_speed` double NOT NULL DEFAULT '0' COMMENT 'get_wind()[''speed'']',
  `wind_deg` double NOT NULL DEFAULT '0' COMMENT 'get_wind()[''deg'']',
  `temp` double NOT NULL COMMENT 'get_temperature(unit=''celsius'')[''temp'']',
  `temp_max` double NOT NULL COMMENT 'get_temperature(unit=''celsius'')[''temp_max'']',
  `rain` double DEFAULT '0' COMMENT 'get_rain()',
  `weather_code` int(11) NOT NULL COMMENT 'get_weather_code()',
  `icon` varchar(10) NOT NULL COMMENT 'get_weather_icon_name()',
  `rainfc3` tinyint(4) NOT NULL COMMENT 'will it rain next 3 h',
  `rainfc5` tinyint(4) NOT NULL COMMENT 'will it rain next 5 h',
  PRIMARY KEY (`timestamp`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
